  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rocky
  Mountain National Wildlife Refuge outlines Refuge accomplishments during the 1998
  fiscal year.The report begins with an introduction to the Refuge. Highlights and
  weather conditions are summarized for the year. Information about monitoring and
  studies- including surveys, censuses, and studies and investigations- is provided
  next. Habitat restoration and management projects are also covered; activities include
  upland restoration, management of water levels, mowing, prescribed burns, and pest
  control. Fish and wildlife management are discussed next with emphasis on bird banding,
  disease monitoring and treatment, nest structures, and predator and fishery resources.
  Coordination activities, such as interagency coordination, private land activities,
  and cooperative organizations are outlined. The resource protection section provides
  an update on law enforcement, wildfire preparedness, contaminant investigation and
  cleanup, management of water rights, and land acquisition. Information about public
  education and recreation is given including visitor facilities, interpretation,
  wildlife-oriented recreation, environmental education, federal junior duck stamp
  program, and outreach. Finally, comprehensive management planning and general administration
  is discussed in the Refuge planning and administration section. A brief narrative
  for Two Ponds National Wildlife Refuge is included.\",\n\t\"license_title\": \"License
